import './Home.css';
import React, { useState } from 'react';

function Home() {

    const [requests, setRequests] = useState([]);

    return (
        <div className="Home">
            <div className="Header">
                Phi Tau Music Request Site
            </div>
            <div className="ListsOfRequests">
                {requests.map((req) => (
                    <div className='rulesPreview' key={req.id}> {req.replace} {req.replaceWith} </div>
                ))}
            </div>
        </div>
    );
}

export default Home;
